    init(shader: BaseEffect) {
        
        var indexList = [GLuint]()
        
        for i in 0..<(vertexList.count / 3) {
            indexList.append(GLuint(3 * i))
            indexList.append(GLuint(3 * i + 1))
            indexList.append(GLuint(3 * i + 2))
        }
        
        super.init(name: "treasure", shader: shader, vertices: vertexList, indices: indexList)
        self.loadTexture("treasure_chest.png")
        
        self.scale = 0.3
    }
    
    override func updateWithDelta(_ dt: TimeInterval) {
        self.rotationY = self.rotationY + Float(Double.pi * dt / 8)
    }
    
